import { useState } from 'react';
import { useEffect } from 'react';
import raw from './data.csv';

export default function CsvReader(){
    const [csvData, setCsvData] = useState(undefined);
    const csvFile = './data.csv';

    useEffect( () => {
        fetch(raw)
        .then(r => r.text())
        .then(text => {
            const lines = text.split("\n");
            let data_points = [lines.length - 1];
            for (let line_num = 1; line_num < lines.lenght; line_num++) {
                data_points[line_num - 1] = lines[line_num].split(",");
            }
            for (let index = 0; index < lines.length; index++) {
                for (let inner_index = 0; inner_index < lines[index].lenght; inner_index++) {
                    console.log(data_points[index][inner_index]);
                }
            }
            setCsvData(text);
        })
    })

    return(
        <div>
            <div className="gcse-search">
            </div>
            {csvData ? csvData: ''}
        </div>
    );

}
